import React from 'react'

function AdminLSidebar() {
  return (
    <div className='adminLsidebar'>
      <ul>
        <p className='LsidebarHeader'>Onboarding</p>
        <li>Users</li>
        <li>Children</li>
      </ul>
    </div>
  )
}

export default AdminLSidebar
